import React from 'react';

const Portfolioitem = props => {
	console.log(props);
	return (
		<div className="portfolio-item">
			{props.name}
			{props.backgroundImageURL}
			{props.link}
			{props.id}
		</div>
	);
};

export default Portfolioitem;
